export function catigirizer(rawStuff, destination) {
    rawStuff.forEach(word => {
        switch (word.length) {
            case 5:
                destination[5].push(word);
                break;
            case 6:
                destination[6].push(word);
                break;
            case 7:
                destination[7].push(word);
                break;
            case 8:
                destination[8].push(word);
                break;
        }
    });
}
